//archivo principal donde tenemos la aplicación
import logo from './logo.svg';
import './App.css';
//importamos componentes 
import CompShowCanchas from './cancha/ShowCanchas';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      {/*Se utilizan 3 componentes para el enrutador, browser, routes, route*/}
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<CompShowCanchas/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
